import React from 'react'

// Shared layouts
import DashboardLayout from 'layouts/Dashboard';
import { withStyles } from '@material-ui/core/styles';

const styles = theme => ({
   root: {
     padding: theme.spacing.unit * 4
   },
   item: {
     height: '100%'
   }
 });

const DataPO = () => {
   return (
      <div>
         Data PO
      </div>
   )
}

export default withStyles(styles)(DataPO);
